import { Flex, Text } from "@chakra-ui/react";

export default function HomePage() {
    return( 
        <Flex alignSelf={'center'} justify={'center'} marginTop={'10px'}>
            <Flex width={'80%'} justify={'center'}>
                <Flex>
                    <Text>Topics</Text>
                </Flex>
            </Flex>
        </Flex>
    )
}
